import styled from 'styled-components'

const Primary = ({className, children}) => (
  <PrimaryStyles className={className}>
    <List>{children}</List>
  </PrimaryStyles>
);

const PrimaryStyles = styled('div')`
  background: var(--purple300);
  height: 100vh;
  grid-column: 1/2;
`;

const List = styled('ul')`
  display: flex;
  flex-direction: column;
  margin: 0;
  padding: 0;
`;

export default Primary;
